function match_langs_pokemon(name, term) {
	var translates = POKEMONNAMES_LANGS[name];
	for (lang in translates) {
		if (translates[lang] && translates[lang].toUpperCase().indexOf(term.toUpperCase()) === 0) {
			return true;
		}
	}

	return false;
}

function match_langs_move(name, term) {
	if (name.toUpperCase().indexOf('HIDDEN POWER') == 0 && term.toUpperCase().indexOf('HP') == 0) {
		if (term.length == 2) {
			return true;
		} else if (term.length == 3) {
			switch (term[2].toUpperCase()) {
				case 'N': return name === 'Hidden Power Normal';
				case 'G': return name === 'Hidden Power Grass' || name === 'Hidden Power Ground' || name === 'Hidden Power Ghost' || name === 'Hidden Power Fairy';
				case 'F': return name === 'Hidden Power Fire' || name === 'Hidden Power Flying' || name === 'Hidden Power Fighting';
				case 'W': return name === 'Hidden Power Water';
				case 'E': return name === 'Hidden Power Electric';
				case 'I': return name === 'Hidden Power Ice';
				case 'B': return name === 'Hidden Power Bug';
				case 'P': return name === 'Hidden Power Poison' || name === 'Hidden Power Psychic';
				case 'R': return name === 'Hidden Power Rock';
				case 'D': return name === 'Hidden Power Dragon' || name === 'Hidden Power Dark';
				case 'S': return name === 'Hidden Power Steel';
				default: return false;
			}
		} else {
			return false;
		}
	}

	var translates = MOVENAMES_LANGS[name];
	for (var lang in translates) {
		if (translates[lang] && translates[lang].toUpperCase().indexOf(term.toUpperCase()) === 0) {
			return true;
		}
	}

	return false;
}